export default {
  name: 'GroupTipElement',
  props: {
    payload: {
      type: Object,
      required: true
    }
  },
  computed: {
    text: function text() {
      return this.getGroupTipContent(this.payload);
    }
  },
  methods: {
    getGroupTipContent: function getGroupTipContent(payload) {
      switch (payload.operationType) {
        case this.TIM.TYPES.GRP_TIP_MBR_JOIN:
          return "\u7FA4\u6210\u5458\uFF1A".concat(payload.userIDList.join(','), "\uFF0C\u52A0\u5165\u7FA4\u7EC4");

        case this.TIM.TYPES.GRP_TIP_MBR_QUIT:
          return "\u7FA4\u6210\u5458\uFF1A".concat(payload.userIDList.join(','), "\uFF0C\u9000\u51FA\u7FA4\u7EC4");

        case this.TIM.TYPES.GRP_TIP_MBR_KICKED_OUT:
          return "\u7FA4\u6210\u5458\uFF1A".concat(payload.userIDList.join(','), "\uFF0C\u88AB").concat(payload.operatorID, "\u8E22\u51FA\u7FA4\u7EC4");

        case this.TIM.TYPES.GRP_TIP_MBR_SET_ADMIN:
          return "\u7FA4\u6210\u5458\uFF1A".concat(payload.userIDList.join(','), "\uFF0C\u6210\u4E3A\u7BA1\u7406\u5458");

        case this.TIM.TYPES.GRP_TIP_MBR_CANCELED_ADMIN:
          return "\u7FA4\u6210\u5458\uFF1A".concat(payload.userIDList.join(','), "\uFF0C\u88AB\u64A4\u9500\u7BA1\u7406\u5458");

        case this.TIM.TYPES.GRP_TIP_GRP_PROFILE_UPDATED:
          return '群资料修改';

        case this.TIM.TYPES.GRP_TIP_MBR_PROFILE_UPDATED:
          return '群成员资料修改';

        default:
          return '[群提示消息]';
      }
    }
  }
};
